window.bookSummaryJSON = "<p>“Mine!” he growls in the throes of passion.</p> <p>“Are you mine too?” I challenge him.</p> <p>Before he can promise anything, his betrothed shows up at his door.</p> <p>The demon queen is pushing for a final claim on him, and a war unlike any other rages between us.</p> <p>I don’t stay down, but when she brings in Barbie 2.0, an upgraded version of me, to tempt him, to replace me—Everything crumbles around me.</p>"; 
